<script>
  let map;
// global array to store the marker object 
let markersArray = [];

function initMap() {
  map = new google.maps.Map(document.getElementById('map'), {
    center: new google.maps.LatLng(-6.2239309, 106.559657),
    zoom: 13
  });
  addMarker({lat: -6.2239309, lng: 106.559657}, "{{ asset('assets_admin/img/icon/baru.svg')}}");
  addMarker({lat: -6.2239309, lng: 106.559657}, "{{ asset('assets_admin/img/icon/marker-driver.svg')}}");
  addMarker({lat: -6.252868, lng: 106.5846652}, "{{ asset('assets_admin/img/icon/marker-hospital.svg')}}");
}

function addMarker(latLng, img) {
  let url = "";
  url += img;

  let marker = new google.maps.Marker({
    map: map,
    position: latLng,
    icon: {
      url: url
    }
  });

  //store the marker object drawn in global array
  markersArray.push(marker);
}
initMap();
</script>
